import React from "react";

const Biographie = () => {
    return (
        <div className="Biographie modules">
            <div className="container">HTML</div>
            <div className="container">CSS/SCSS</div>
            <div className="container">JavaScript</div>
        </div>
    );
};

export default Biographie;
